    true,nt"url": null,nt"notes": "This report covers data acquisition, instrumentation
    and processing of a gravity survey performed on the Glass Buttes Geothermal Exploration
    Project, located in Lake County, Oregon for ORMAT Technologies Inc. The survey was
    conducted during 21 June 2010 to 26 June 2010.  The survey area is located in T23S,
    R21-23E and lies within the Glass Buttes, Hat Butte, and Potato Lake, Oregon 1:24,000
    topographic sheets. A total of 180 gravity stations were acquired along five profile
    lines.  ",nt"license_title": "Creative Commons Attribution",nt"extras":
